-- Create indexes for fast free text searches
CREATE INDEX composition_notes_idx ON labcontrol.composition USING gin(to_tsvector('english', notes));
CREATE INDEX plate_notes_idx ON labcontrol.composition USING gin(to_tsvector('english', notes));

