-- Creating a function to fast retrieve the study titles from a plate
CREATE OR REPLACE FUNCTION labcontrol.get_plate_studies(in_plate_id BIGINT) RETURNS varchar[] AS $$
DECLARE
    plate_type  VARCHAR;
BEGIN
    SELECT DISTINCT description INTO plate_type
        FROM labcontrol.plate
            JOIN labcontrol.well USING (plate_id)
            JOIN labcontrol.composition USING (container_id)
            JOIN labcontrol.composition_type USING (composition_type_id)
        WHERE plate_id = in_plate_id;

    IF plate_type = 'sample' THEN
        RETURN (SELECT array_agg(DISTINCT study_title)
                FROM qiita.study
                    JOIN qiita.study_sample USING (study_id)
                    JOIN labcontrol.sample_composition USING (sample_id)
                    JOIN labcontrol.composition USING (composition_id)
                    JOIN labcontrol.well USING (container_id)
                WHERE plate_id = in_plate_id);
    ELSIF plate_type = 'gDNA' THEN
        RETURN (SELECT array_agg(DISTINCT study_title)
                FROM qiita.study
                    JOIN qiita.study_sample USING (study_id)
                    JOIN labcontrol.sample_composition USING (sample_id)
                    JOIN labcontrol.gdna_composition gdna USING (sample_composition_id)
                    JOIN labcontrol.composition c ON gdna.composition_id = c.composition_id
                    JOIN labcontrol.well USING (container_id)
                WHERE plate_id = in_plate_id);
    ELSIF plate_type = '16S library prep' THEN
        RETURN (SELECT array_agg(DISTINCT study_title)
                FROM qiita.study
                    JOIN qiita.study_sample USING (study_id)
                    JOIN labcontrol.sample_composition USING (sample_id)
                    JOIN labcontrol.gdna_composition USING (sample_composition_id)
                    JOIN labcontrol.library_prep_16s_composition lp USING (gdna_composition_id)
                    JOIN labcontrol.composition c ON lp.composition_id = c.composition_id
                    JOIN labcontrol.well USING (container_id)
                WHERE plate_id = in_plate_id);
    ELSIF plate_type = 'compressed gDNA' THEN
        RETURN (SELECT array_agg(DISTINCT study_title)
                FROM qiita.study
                    JOIN qiita.study_sample USING (study_id)
                    JOIN labcontrol.sample_composition USING (sample_id)
                    JOIN labcontrol.gdna_composition USING (sample_composition_id)
                    JOIN labcontrol.compressed_gdna_composition comp USING (gdna_composition_id)
                    JOIN labcontrol.composition c ON comp.composition_id = c.composition_id
                    JOIN labcontrol.well USING (container_id)
                WHERE plate_id = in_plate_id);
    ELSIF plate_type = 'normalized gDNA' THEN
        RETURN (SELECT array_agg(DISTINCT study_title)
                FROM qiita.study
                    JOIN qiita.study_sample USING (study_id)
                    JOIN labcontrol.sample_composition USING (sample_id)
                    JOIN labcontrol.gdna_composition USING (sample_composition_id)
                    JOIN labcontrol.compressed_gdna_composition USING (gdna_composition_id)
                    JOIN labcontrol.normalized_gdna_composition norm USING (compressed_gdna_composition_id)
                    JOIN labcontrol.composition c ON norm.composition_id = c.composition_id
                    JOIN labcontrol.well USING (container_id)
                WHERE plate_id = in_plate_id);
    ELSIF plate_type = 'shotgun library prep' THEN
        RETURN (SELECT array_agg(DISTINCT study_title)
                FROM qiita.study
                    JOIN qiita.study_sample USING (study_id)
                    JOIN labcontrol.sample_composition USING (sample_id)
                    JOIN labcontrol.gdna_composition USING (sample_composition_id)
                    JOIN labcontrol.compressed_gdna_composition USING (gdna_composition_id)
                    JOIN labcontrol.normalized_gdna_composition USING (compressed_gdna_composition_id)
                    JOIN labcontrol.library_prep_shotgun_composition lp USING (normalized_gdna_composition_id)
                    JOIN labcontrol.composition c ON lp.composition_id = c.composition_id
                    JOIN labcontrol.well USING (container_id)
                WHERE plate_id = in_plate_id);
    ELSE
        RETURN NULL;
    END IF;
END
$$ LANGUAGE plpgsql;

DO $do$
DECLARE

  -- Variables for externally extracted samples
  rc_process_type_id                  BIGINT;
  rc_process_id_none                  BIGINT;
  tube_container_type_id              BIGINT;
  none_container_id                   BIGINT;
  reagent_comp_type                   BIGINT;
  none_composition_id                 BIGINT;
  none_reagent_comp_type              BIGINT;
BEGIN
   -- Add 'Not applicable' reagents for externally extracted samples
  SELECT process_type_id INTO rc_process_type_id
      FROM labcontrol.process_type
      WHERE description = 'reagent creation';

      VALUES (rc_process_type_id, '05/01/1984', 'LabControl@labcontrol.com')
      RETURNING process_id INTO rc_process_id_none;

  SELECT container_type_id INTO tube_container_type_id
      FROM labcontrol.container_type
      WHERE description = 'tube';

      VALUES (tube_container_type_id, rc_process_id_none, 42)
      RETURNING container_id INTO none_container_id;

      VALUES (none_container_id, 'Not applicable');

  SELECT composition_type_id INTO reagent_comp_type
      FROM labcontrol.composition_type
      WHERE description = 'reagent';

      VALUES (reagent_comp_type, rc_process_id_none, none_container_id, 42)
      RETURNING composition_id INTO none_composition_id;

  SELECT reagent_composition_type_id INTO none_reagent_comp_type
      FROM labcontrol.reagent_composition_type
      WHERE description = 'extraction kit';

      VALUES (none_composition_id, none_reagent_comp_type, 'Not applicable');

END $do$
